-- Table structure for table `detailed_weather`
--

DROP TABLE IF EXISTS `detailed_weather`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `detailed_weather` (
  `daytime` enum('night','morning','day','evening') NOT NULL default 'night',
  `weather_id` int(11) NOT NULL default '0',
  `time` time default NULL,
  `graph` tinyint(4) default NULL,
  `cloud` tinyint(4) default NULL,
  `temperature` decimal(3,1) default NULL,
  `description` varchar(255) default NULL,
  `ge_description` varchar(255) default NULL,
  `pressure_mb` decimal(5,1) default NULL,
  `pressure_torr` decimal(4,1) default NULL,
  `humidity` tinyint(4) default NULL,
  `wind_direction_degrees` smallint(6) default NULL,
  `wind_direction_lang` varchar(3) default NULL,
  `wind_speed` tinyint(4) default NULL,
  PRIMARY KEY  (`daytime`,`weather_id`),
  KEY `detailed_weather_weather_id_daily_weather_id` (`weather_id`),
  CONSTRAINT `detailed_weather_weather_id_daily_weather_id` FOREIGN KEY (`weather_id`) REFERENCES `daily_weather` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
SET character_set_client = @saved_cs_client;

